import "./checkout.style.scss"
import { useContext } from "react"
import { CartContext } from "../../contexts/cart.context"

const Checkout = () => {
    const {cartItems} = useContext(CartContext);
    return (
        <div>
            <h1>Checkout page</h1>
            {cartItems.map(({id, name, price}) => {
                <div key={id}>
                    <h2>{name}</h2>
                    <span>{price}</span>
                </div>
            })}
        </div>

    )
}

export default Checkout
